INSERT INTO `posts` VALUES (1,'Cơ bản về Java Deserialization','Trong Java, các object sẽ được lưu trữ vào bộ nhớ heap trong JVM. Vì vậy khi chương trình kết thúc tức là JVM dừng cũng có nghĩa là các object này sẽ bị mất. Vì vậy để có thể sử dụng lại object cũng như việc lưu trữ chúng hay việc chuyển chúng qua network thì cần có đến 2 quá trình serialization và deserialization.\r\n\r\nSerialization: Đây là cơ chế chuyển object sang dạng byte stream (mảng byte).\r\n\r\nDeserialization: Quá trình này ngược lại với trên là chuyển từ byte stream sang object.',1),(2,'Java Reflection','Reflection là 1 API trên Java sử dụng để truy xuất, sửa đổi hành vì của fields, methods, classes, interfaces trong quá trình runtime. Điều này đặc biệt hữu ích khi không biết tên chúng tại thời điểm compile hay do server filter 1 số thứ.\r\n',2),(3,'Kỹ thuật khai thác LFI thông qua Nginx temp files','Nginx cung cấp tính năng \"client body buffering\" để đọc client request body. Và nếu request body đó lớn hơn buffer thì toàn bộ body hoặc một phần có thể ghi vào temp file.\r\n\r\n\r\nTemp file sẽ được Nginx xóa sau khi nó mở. Tuy nhiên procfs có thể tham chiếu đến file đã xóa đó thông qua race.\r\n\r\nprocfs (proc file system) là một hệ thống tệp ảo sử dụng để cung cấp thông tin về các tiến trình đang chạy trên hệ thống.\r\n/proc/self/ chứa các tiến trình đang chạy, trong này thư mục fd/(chứa các symlink đến các file mở bởi tiến trình hiện đang thực thi có tên là các số tương ứng với số file descriptor).\r\n\r\n\r\nTrong ví dụ trên, hàm include() hay các hàm tương tự trong PHP sẽ không include được /proc/34/fd/15 vì nó tham chiếu đến file đã bị xóa là /var/lib/nginx/body/0000001368. Tuy nhiên lại bypass được bằng cách sử dụng /proc/self/fd/34/../../../34/fd/15 và sẽ thực thi nội dung /var/lib/nginx/body/0000001368.\r\n\r\n\r\n\r\n\r\n\r\n',1);
